import class_profile from "./Profile.module.css";
import MyPosts from "./MyPosts/MyPosts.jsx";
import ProfileInfo from "./ProfileInfo/ProfileInfo.jsx";

const Profile = () => {
  return (
    <div className={class_profile.image_length}>
      <ProfileInfo />
      <MyPosts />
    </div>
  );
};

export default Profile;
